export default function Footer() {
  return (
    // <footer className="bg-bkg-2 text-text font-roboto text-base">
    //   <div className="flex justify-center items-center h-[7.25rem]">
    //     <p className="text-center">Thank you for visiting my portfolio :) </p>
    //   </div>
    // </footer>
    <footer id="footer">
      <div className="footer-background">
        <div className="footer-blob"></div>
      </div>
      <div className="footer-foreground">
        <div className="footercontainer">
          <div className="two-words">
            <article
              tabindex="0"
              aria-label="Learning, Living, and Leveling Up, my quote"
            >
              "Learning, Living, and Leveling Up."
            </article>
          </div>
          <div className="social-media-container">
            <div className="getintouch-heading">
              <article>GetinTouch();</article>
            </div>
          </div>
          <div className="footer-avatar-container">
            <img
              src="./cat1.png"
              alt="animation-head"
              className="footer-avatar-img"
              id="footer-wala-avatar"
            />
            <div className="footer-avatar-face">
              <div className="footer-avatar-eye footer-left-eye">
                <div className="footer-pupil"></div>
              </div>
              <div className="footer-avatar-eye footer-right-eye">
                <div className="footer-pupil"></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
}
// footer.jsx

let Pupils = document.getElementsByClassName("footer-pupil");
let pupilsArr = Array.from(Pupils);

let pupilStartPoint = -10;
let pupilRangeX = 20;
let pupilRangeY = 15;

// mouse X
let mouseXStartPoint = 0;
let mouseXEndPoint = window.innerWidth;
let currentXPosition = 0;
let fracXValue = 0;

// mouse Y position
let mouseYEndPoint = window.innerHeight;
let currentYPosition = 0;
let fracYValue = 0;

let mouseXRange = mouseXEndPoint - mouseXStartPoint;

const mouseMove = (event) => {
  currentXPosition = event.clientX - mouseXStartPoint;
  fracXValue = currentXPosition / mouseXRange;

  currentYPosition = event.clientY;
  fracYValue = currentYPosition / mouseYEndPoint;

  // footer
  let pupilXCurrrentPosition = pupilStartPoint + fracXValue * pupilRangeX;
  let pupilYCurrrentPosition = pupilStartPoint + fracYValue * pupilRangeY;

  // footer
  pupilsArr.forEach((curPupil) => {
    curPupil.style.transform = `translate(${pupilXCurrrentPosition}px, ${pupilYCurrrentPosition}px)`;
  });
};

const windowResize = (event) => {
  mouseXEndPoint = window.innerWidth;
  mouseYEndPoint = window.innerHeight;
  mouseXRange = mouseXEndPoint - mouseXStartPoint;
};

window.addEventListener("mousemove", mouseMove);
window.addEventListener("resize", windowResize);
